import React from 'react';

import { LanguageContext } from '../../context/LanguageContext';
import './Financing.css';
import image from './images/graph.png';

class Financing extends React.Component {

    static contextType = LanguageContext;

    render() {
        let financingData = this.context.financing;

        return(
            <section id="financing">
                <div className="container">
                    <div className="content-title">
                        <h2>{financingData.title}</h2>

                        <div className="separator">
                            <div className="large"></div>
                            <div className="medium"></div>
                            <div className="small"></div>
                        </div>

                        <p>{financingData.description}</p>
                    </div>

                    <div className="content">
                        <div className="content-data">
                            <h3>{financingData.textTitle}</h3>

                            <ul>
                                <li>&#5125; {financingData.infoList.item1}</li>
                                <li>&#5125; {financingData.infoList.item2}</li>
                                <li>&#5125; {financingData.infoList.item3}</li>
                                <li>&#5125; {financingData.infoList.item4}</li>
                                <li>&#5125; {financingData.infoList.item5}</li>
                                <li>&#5125; {financingData.infoList.item6}</li>
                                <li>&#5125; {financingData.infoList.item7}</li>
                                <li>&#5125; {financingData.infoList.item8}</li>
                                <li>&#5125; {financingData.infoList.item9}</li>
                            </ul>

                            <p>{financingData.simbol}: DMX</p>
                        </div>

                        <div className="content-image">
                            <img src={image} alt={financingData.imageDescription}/>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}

export default Financing;
